import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

function Navbar(props) {
// const [isSignedIn, setIsSignedIn] = useState(true);

let setIsSignedIn = props.setIsSignedIn;
let isSignedIn = props.isSignedIn;
let currentUser = props.currentUser

function setSignOut() {
  isSignedIn(false);
  console.log(isSignedIn, "setSignOut fired")
}

useEffect(() => {
  console.log(isSignedIn, "Sign In Status from useEffect in Navbar");
}, [isSignedIn]);

  return (

  <div className="navbar">
  <span className="navlink">
  <Link to="/">Home</Link>
  </span>
  {isSignedIn ? (
  <>
    <span className="navlink">
      <Link to="/my-account">My Account</Link>
    </span>
    <span className="navlink">

     <Link onClick={setSignOut} to="/">Logout</Link>
    </span>
  </>
    ) : (
  <>
    <span className="navlink">
    <Link to="/my-account">My Account</Link>
    </span>
    <span className="navlink">
      <Link to="/sign-in">Sign In</Link>
    </span>
    <span className="navlink">
     <Link onClick={setSignOut} to="/">Logout</Link>
    </span>
  </>
  )}
  </div>
  );
}

export default Navbar;
